  false,\n\t\"url\": null,\n\t\"notes\": \"Mapped hunt boundary is an approximation
  of regulations using best available data as of September 2015. Hunters are responsible
  for knowing the exact current boundary locations as described within the California
  Code of Regulations, Title 14, Section 300(a)(1)(E)3:3. Area Open Zone: The open
  hunting zone for sooty and ruffed grouse includes the following counties: Alpine,
  Amador, Butte, Calaveras, Del Norte, El Dorado, Fresno, Glenn, Humboldt, Inyo, Lake,
  Lassen, Madera, Mariposa, Mendocino, Modoc, Mono, Nevada, Placer, Plumas, Shasta,
  Sierra, Siskiyou, Tehama, Trinity, Tulare, Tuolumne, and Yuba. All other counties
  are closed to the taking of sooty or ruffed grouse.\",\n\t\"owner_org\": \"467d900f-8a42-452d-9906-6610dd1a767f\",\n\t\"extras\":
